import React from "react";
import "./testhover.css";
import { Row, Col } from "reactstrap";

const datas = [
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition:
      "TestDecritionsssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssss",
    href: "/",
  },
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition:
      "TestDecritionsssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssss",
    href: "/",
  },
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition:
      "TestDecritionsssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssss",
    href: "/",
  },
];

export default function Testhover() {
  return (
    <div>
      <div className="container">
        {datas.map(function (data, i) {
          return (
            <Row xs="4">
              <Col>
                <div className="card">
                  <img src={data.img} alt={data.alt} className="card-img-top" />
                  <div className="card-body">
                    <h5 className="card-title">{data.title}</h5>
                    <p className="card-text">{data.decrition}</p>
                    <a href={data.href} className="btn">
                      More
                    </a>
                  </div>
                </div>
              </Col>
            </Row>
          );
        })}
      </div>
    </div>
  );
}
